('news-2', 'TRANG PHỤC MẶC NHÀ CHO MÙA HÈ THOẢI MÁI', '2021-09-22', 'Hè sang, thời tiết trở nên dần nóng bức, thời gian ở nhà nhiều hơn, UNIQLO mang đến các sản phẩm thoáng mát, thấm hút mồ hôi giúp bạn tận hưởng những giây phút ở nhà trọn vẹn hơn.\nHơn thế, khi những chuyến du lịch bị hạn chế cũng là lúc bạn có thể dành thêm thời gian bên gia đình và bạn bè với những buổi tiệc nướng BBQ tại vườn hoặc trong công viên. Đồ mặc nhà sẽ trở nên cực kỳ hữu ích trong những dịp như vậy đấy.', 'staff-1', 0x68747470733a2f2f7777772e756e69716c6f2e636f6d2f766e2f6e6577732f746f706963732f323032313035313130312f696d672f7468756d625f6c6c2e6a7067, '<h1>Sport Utility Wear là một khái niệm mới đến từ UNIQLO, nhằm hướng đến sự đa năng và tiện lợi trong cuộc sống thường nhật. Được sản xuất từ chất liệu khô nhanh và co giãn tối ưu, các sản phẩm thể thao này không chỉ có thể mặc khi tập luyện mà còn mặc được trong nhiều dịp hàng ngày với nhiều phong cách linh hoạt. Bạn có thể mặc &quot;Sports Utility Wear&quot; trong bất kỳ hoàn cảnh nào, dù đi chơi, nghỉ ngơi tại nhà hay thậm chí là mặc đến văn phòng làm việc.</h1> <p><img src=\"https://raw.githubusercontent.com/khoaluantotnghiep-09dhth-hufi/baocao/main/Image/women/goods_00_441832.jpg\" alt=\"img\"> <strong>Sport Utility Wear là một khái niệm mới đến từ UNIQLO, nhằm hướng đến sự đa năng và tiện lợi trong cuộc sống thường nhật. Được sản xuất từ chất liệu khô nhanh và co giãn tối ưu, các sản phẩm thể thao này không chỉ có thể mặc khi tập luyện mà còn mặc được trong nhiều dịp hàng ngày với nhiều phong cách linh hoạt. Bạn có thể mặc &quot;Sports Utility Wear&quot; trong bất kỳ hoàn cảnh nào, dù đi chơi, nghỉ ngơi tại nhà hay thậm chí là mặc đến văn phòng làm việc.</strong> <img src=\"https://raw.githubusercontent.com/khoaluantotnghiep-09dhth-hufi/baocao/main/Image/women/goods_00_4418792.jpg\" alt=\"img\"></p>'),
('news-3', 'UNIQLO TODAY BỘ SƯU TẬP HANA TAJIMA x UNIQLO: TRANG PHỤC LifeWear - ĐƠN GIẢN VÀ TỰ NHIÊN CHO PHỤ NỮ TRƯỞNG THÀNH', '2021-05-21', 'Bộ sưu tập HANA TAJIMA x UNIQLO Xuân / Hè 2021 là lựa chọn hoàn hảo cho thời điểm biến chuyển trong phong cách sống và sự ưu tiên của xã hội hôm nay. Lấy cảm hứng từ ý tưởng \"thay đổi phong cách sống\", những trang phục trong Bộ sưu tập đều vô cùng tiện lợi và thiết thực nhằm hướng đến việc cho phép người mặc được là chính mình khi khoác lên chúng. Đây là bộ sưu tập thứ 12 tại Nhật Bản kể từ khi ra mắt bộ sưu tập đầu tiên Hana Tajima kết hợp cùng UNIQLO vào năm 2015.', 'staff-1', 0x68747470733a2f2f7777772e756e69716c6f2e636f6d2f766e2f6e6577732f746f706963732f323032313035303530312f696d672f7468756d625f6c6c2e6a7067, '<h1>Sport Utility Wear là một khái niệm mới đến từ UNIQLO, nhằm hướng đến sự đa năng và tiện lợi trong cuộc sống thường nhật. Được sản xuất từ chất liệu khô nhanh và co giãn tối ưu, các sản phẩm thể thao này không chỉ có thể mặc khi tập luyện mà còn mặc được trong nhiều dịp hàng ngày với nhiều phong cách linh hoạt. Bạn có thể mặc &quot;Sports Utility Wear&quot; trong bất kỳ hoàn cảnh nào, dù đi chơi, nghỉ ngơi tại nhà hay thậm chí là mặc đến văn phòng làm việc.</h1> <p><img src=\"https://raw.githubusercontent.com/khoaluantotnghiep-09dhth-hufi/baocao/main/Image/women/goods_00_441832.jpg\" alt=\"img\"> <strong>Sport Utility Wear là một khái niệm mới đến từ UNIQLO, nhằm hướng đến sự đa năng và tiện lợi trong cuộc sống thường nhật. Được sản xuất từ chất liệu khô nhanh và co giãn tối ưu, các sản phẩm thể thao này không chỉ có thể mặc khi tập luyện mà còn mặc được trong nhiều dịp hàng ngày với nhiều phong cách linh hoạt. Bạn có thể mặc &quot;Sports Utility Wear&quot; trong bất kỳ hoàn cảnh nào, dù đi chơi, nghỉ ngơi tại nhà hay thậm chí là mặc đến văn phòng làm việc.</strong> <img src=\"https://raw.githubusercontent.com/khoaluantotnghiep-09dhth-hufi/baocao/main/Image/women/goods_00_4418792.jpg\"